import React from "react";
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import Stepper from "@material-ui/core/Stepper"
import Step from "@material-ui/core/Step"
import StepLabel from "@material-ui/core/StepLabel"
import { RegisterOne } from "./First";
import { RegisterTwo } from "./Second";
import { RegisterThree } from "./Third";
import { RegisterFourth } from "./Fourth";
import { RegisterFive } from "./Five";
import { RegisterSix } from "./Six";
import { RegisterSeven } from "./Seven";



const useStyles = makeStyles((theme) => ({
    image: {
        backgroundImage: 'url(https://source.unsplash.com/random)',
        backgroundColor:
            theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
        backgroundSize: 'cover',
        backgroundPosition: 'center',
    },
    paper: {
        margin: theme.spacing(8, 4),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    logoBig: {
        marginTop: 22,
        marginBottom: 40,
        backgroundColor: '#DEDEDE',
        color: '#FFFFFF',
    },
    loginButton: {
        backgroundColor: '#4E5674',
        borderRadius: 10,
        width: 150,
        height: 50,
    },
    root: {
        width: '100%',
    },
}));

export const Register = () => {
    const classes = useStyles();
    const [activeStep, setActiveStep] = React.useState(0)
    const nextStep = () => {
        if (activeStep < 8) {
            setActiveStep((currentStep) => currentStep + 1)
        }
    }

    const previousStep = () => {
        if (activeStep !== 0) {
            setActiveStep((currentStep) => currentStep - 1)
        }
    }

    const steps = [
        RegisterOne,
        RegisterTwo,
        RegisterSix,
        RegisterThree,
        RegisterFourth,
        RegisterFive,
    ];
    const CurrentStep = steps[activeStep];
    return (
        <Grid container component="main" className={classes.root}>

            <Grid item xs={false} sm={3} md={3} className={classes.image} />
            <Grid item xs={12} sm={9} md={9} component={Paper} elevation={6} square>
                <div className={classes.paper}>
                    <Button variant="contained" className={classes.logoBig}>Logo</Button>

                    <div>
                        <Stepper activeStep={activeStep}>
                            <Step>
                                <StepLabel></StepLabel>
                            </Step>
                            <Step>
                                <StepLabel></StepLabel>
                            </Step>
                            <Step>
                                <StepLabel></StepLabel>
                            </Step>
                            <Step>
                                <StepLabel></StepLabel>
                            </Step>
                            <Step>
                                <StepLabel></StepLabel>
                            </Step>
                            <Step>
                                <StepLabel></StepLabel>
                            </Step>
                        </Stepper>
                        <h3>{activeStep}</h3>
                        <button variant="outlined" color="primary" onClick={() => previousStep()}>
                            Paso anterior
                        </button>
                        <button variant="outlined" color="primary" onClick={() => nextStep()}>
                            Próximo paso
                        </button>

                        <CurrentStep hello="Wrold" />
                    </div>



                    <div className='login'>
                        <Button
                            type="submit"
                            variant="contained"
                            color="primary"
                            className={classes.loginButton}
                            onClick={() => nextStep()}
                        >
                            Siguiente
                        </Button>
                    </div>
                </div>
            </Grid>
        </Grid>
    );
}
